function setTileData(anObject) {
    var morph,
        morphExtent;
    this.date = new Date(0);
    for (var prop in anObject) {
        if (prop == 'date') { this.date = anObject[prop]; }
        morph = this.get(prop);
        if (!morph) { continue; }
        morphExtent = morph.getExtent();
        morph.setTileData(anObject[prop]);
        if (morph.isText) {
            morph.fitInto(morphExtent);
        }
    }
}
